import React from "react";

function ProductList (props){
    
return(
   <div className="col-md-3 col-sm-6 ">
    <div className="card">
        <div className="card-header">
            <img src={props.image}/>
            <div className="card-body">
                <h1>{props.name}</h1>

              </div>
           </div>
         </div>
    </div>
);
}
export default ProductList
